import axios from "../apis/api";

export const logIn = formValues => async dispatch => {
  const data = null;
  console.log(formValues);
  await axios.post('/login', {formValues})
    .then(response => {
      console.log(response)
  })

  dispatch({
    type: 'LOG_IN',
    payload: data
  });
};
